import { Col, Form } from "react-bootstrap";

export function RequestForm2ndRow({ contribution }) {
  return (
    <>
      <Col md={6}>
        <Form.Group>
          <Form.Label value={contribution}>Pradinis įnašas</Form.Label>
          <Form.Control type="number" placeholder="0" />
          <Form.Text>10% automobilio sumos</Form.Text>
        </Form.Group>
      </Col>
      <Col md={6}>
        <Form.Group>
          <Form.Label>Pradinis įnašas %</Form.Label>
          <Form.Control type="number" placeholder="0" />
        </Form.Group>
      </Col>
    </>
  );
}
